import React, {useState} from 'react'
import Menubar, {SideNavBar} from '../components/menu-bar'
import {
  BarChart,
  DoughnutChart
} from '../components/charts'


const AccountDash = () => {
  return (
    <div style={{
        display: 'flex'}}>
        <div>
          <DoughnutChart/>
        </div>
        <div>
      <BarChart/>
        </div>
    </div>
  )
}

const ShipmentDash = () => {
  return (
    <>
      <p>Working on shipments</p>
    </>
  )
}

const BillingDash = () => {
  return (
    <>
      <p>Work in progress</p>
    </>
  )
}

const SettingsDash = () => {
  return (
    <>
      <p>Work in progress</p>
    </>
  )
}

export default function Dashboard() {

  const [dash, setDash] = useState({
    display: 'account'
  })

  return (
    <div className='mainDashC8R'>
      <SideNavBar
        action={setDash}/>
      <div className='displayArea'>
        <Menubar/>
        {dash.display == 'account' && <AccountDash/>}
        {dash.display == 'shipment' && <ShipmentDash/>}
        {dash.display == 'billing' && <BillingDash/>}
        {dash.display == 'settings' && <SettingsDash/>}
      </div>
    </div>
  )
}
